import { useState, useEffect } from "react";

export default function Vans() {

  const [vans, setVans] = useState([]);
  useEffect(() => {
    fetch('/api/vans')
    .then(data => data.json())
    .then(result => setVans(result));
  }, []);

  const vanComponent = vans.map(van => {
    return (<main className="vans-container">
            <section>
                <h1>Explore our van options</h1>
                <div className="vans-buttons">
                  <button>modern</button>
                  <button>classic</button>
                  <button>old school</button>
                </div>
                <h2>van.name</h2>
                <img src={van.img} alt='van avatar' />
            </section>
        </main>
     );
  });
  return (
    vanComponents
  );
};
